    <script>
      (function() {
        const jsonp = {}

        function loadModule(manifest) {
          const p = []

          if (manifest['.css'] != null) {
            for (var idx = 0; idx < manifest['.css'].length; idx++) {
              p.push(new Promise((resolve, reject) => {
                var link = document.createElement('link')
                link.onload = resolve
                link.onerror = reject
                link.rel = 'stylesheet'
                link.href = 'lib/' + manifest['.css'][idx]
                document.body.appendChild(link)
              }))
            }
          }

          if (manifest['.js'] != null) {
            for (var idx = 0; idx < manifest['.js'].length; idx++) {
              p.push(new Promise((resolve, reject) => {
                var script = document.createElement('script')
                script.onload = resolve
                script.onerror = reject
                script.src = 'lib/' + manifest['.js'][idx]
                document.body.appendChild(script)
              }))
            }
          }

          return Promise.all(p)
        }

        function deserialize(str) {
          const buffer = Uint8Array.from(atob(str), c => c.charCodeAt(0))
          const json = new TextDecoder().decode(buffer)
          const result = JSON.parse(json)
          return result
        }

        function __loadEntry() {
          return loadModule(JSON.parse(document.getElementById('__ENTRY__').textContent))
        }

          const manifest = JSON.parse(document.getElementById('__REMOTE_ENTRIES__').textContent)

  <body>
    <div id="app"></div>
    <script>
  (function(root) {
    window.partnerContent = [];

    var quizId = "eg1TIaOnMGlBDQw5UgddDjrZjy-2j6ms";
    var storylineId = null;
    var completionPercentage = 100;

    var LMSProxy = lms();

    var assign = LMSProxy.utils.assign;
    var debounce = LMSProxy.utils.debounce;

    var cache = null;

    LMSProxy.InitCompletion(isComplete);

    function updateParentTitle() {
      if (window.parent && window.parent.document) {
        if (window.parent.getCourseTitle) {
          document.title = window.parent.getCourseTitle();
        }

        const parentFrame = window.parent;

        function updateParent() {
          try {
            const newLang = document.documentElement.lang;
            const newTitle = document.title

            if (parentFrame?.document?.documentElement) {
              if (parentFrame.document.documentElement.lang !== newLang) {
                parentFrame.document.documentElement.lang = newLang
              }

              if (parentFrame.document.title !== newTitle) {
                parentFrame.document.title = newTitle
                const iframe = parentFrame.document.getElementById('content-frame')
                if (iframe) iframe.title = newTitle
              }
            }
          } catch {
            // shouldn't happen
          }
        }

        const langObserver = new MutationObserver(updateParent);
        langObserver.observe(document.documentElement, {
          attributes: true,
          attributeFilter: ['lang'],
        });

        const titleElement = document.querySelector('title');
        if (titleElement) {
          const titleObserver = new MutationObserver(updateParent);
          titleObserver.observe(titleElement, {
            characterData: true,
            childList: true,
            subtree: true,
          });
        }

        updateParent()
      }
    }

    function compress(data) {
      try {
        return JSON.stringify({
          v: 2,
          d: lzwCompress.pack(JSON.stringify(data)),
          cpv: "7VgJiQsp"
        });
      } catch(e) {
        return '';
      }
    }

    function decompress(stringData) {
      try {
        const data = JSON.parse(stringData);

        return data.d
          ? JSON.parse(lzwCompress.unpack(data.d))
          : data;
      } catch(e) {
        return {};
      }
    }

    function identity(value) {
      return value;
    }

    var sendChunkData = debounce(function() {
      LMSProxy.SetDataChunk(compress(cache));
    }, 100);

    function isPassed() {
      return !!getLMSData().passed;
    }

    function isComplete() {
      var progress;

      if(quizId === null) {
        progress = getLMSData().totalProgress;
        return (progress !== undefined && progress >= completionPercentage);
      }

      return getLMSData().passed !== undefined;
    }

    function getLMSData() {
      var data = null;

      if(!cache) {
        data = LMSProxy.GetDataChunk();

        var result = data
          ? decompress(data)
          : {};

        cache = result;
      }

      return cache;
    }

    function concatLMSData(data) {
      assign(cache, data);
      sendChunkData();
    }

    function completeOut(passed) {
      if(passed) {
        LMSProxy.SetPassed();
      } else {
        LMSProxy.SetFailed();
      }
    }

    function bookmark(id) {
      var url = '#/lessons/' + id;

      LMSProxy.SetBookmark(url, '');
    }

    function reportScore(score) {
      var highScore = Math.max(getLMSData().score || 0, score);

      if(highScore === score) {
        concatLMSData({ score: highScore });
        LMSProxy.SetScore(highScore, 100, 0);
      }
    }

    function finish(totalProgress) {
      if (
        quizId === null &&
        storylineId === null &&
        !isComplete() &&
        completionPercentage !== undefined
      ) {
        if(totalProgress >= completionPercentage) {
          concatLMSData({ totalProgress: totalProgress });
          completeOut(true);
        }
      }
    }

    function finishQuiz(passed, score, id) {
      if (id == quizId) {
        var prevScore = getLMSData().score
        reportScore(score);

        if(prevScore == null || prevScore < score) {
          concatLMSData({ passed: passed });
          completeOut(passed);
        }
      }
    }

    function finishStoryline(id, passed, isQuiz, score) {
      if (id == storylineId) {
        if(isQuiz) {
          reportScore(score);
        }

        completeOut(passed);
      }
    }

    function getLocale() {
      return getLMSData().locale;
    }

    function getProgress(initialProgress) {
      var decodeCourseProgress =
        root.Rise.decodeCourseProgress;

      var progress = assign({}, {
        progress: { lessons: {} }
      }, getLMSData()).progress;

      if(initialProgress) {
        return decodeCourseProgress(initialProgress, progress);
      }

      return progress;
    }

    function isExport() {
      return true;
    }

    function setLessonProgress(lessonProgress) {
      var encodeLessonProgress =
        root.Rise.encodeLessonProgress;

      var currentProgress = getProgress();

      var lessons = assign(
        {},
        currentProgress.lessons,
        encodeLessonProgress(lessonProgress)
      );

      var progress = assign({}, currentProgress, { lessons: lessons });

      concatLMSData({ progress: progress });
    }

    function setCourseProgress(courseProgress, lessonPayload) {
      var encodeCourseProgress =
        root.Rise.encodeCourseProgress;

      var currentProgress = getProgress();
      var lessonId = lessonPayload.id;

      var progress = assign(
        {},
        currentProgress,
        encodeCourseProgress(courseProgress)
      );

      concatLMSData({ progress: progress });

      LMSProxy.FinishLesson(courseProgress.percentComplete, lessonId);
    }

    function setLocale(locale) {
      concatLMSData({ locale: locale });
    }

    function resolvePath(path) {
      return ('assets/').concat(path);
    }

    function resolveFontPath(font) {
      return ('lib/fonts/').concat(font.key.split('/').reverse()[0]);
    }

    function exit() {
      LMSProxy.ConcedeControl();
    }

    function reportAnswer(data) {
      return LMSProxy.ReportAnswer(data);
    }

    function GetStudentID() {
      try {
        var actor = LMSProxy.GetActor();
        if (!actor) {
          return '';
        }
        
        // Try to get identifier in order of preference
        if (actor.account && actor.account.name) {
          return actor.account.name;
        }
        if (actor.mbox) {
          // Remove 'mailto:' prefix if present
          return actor.mbox.replace('mailto:', '');
        }
        if (actor.mbox_sha1sum) {
          return actor.mbox_sha1sum;
        }
        if (actor.openid) {
          return actor.openid;
        }
        
        // Fallback to stringified version of the actor
        if (actor.asVersion) {
          return JSON.stringify(actor.asVersion());
        }
        
        return '';
      } catch(e) {
        return '';
      }
    }

    root.Rise = {
      completeLessons: identity,
      decodeCourseProgress: identity,
      encodeCourseProgress: identity,
      encodeLessonProgress: identity,
    }

    root.Runtime = {
      bookmark: bookmark,
      exit: exit,
      fetch: window.__fetchCourse,
      finish: finish,
      finishQuiz: finishQuiz,
      finishStoryline: finishStoryline,
      getLocale: getLocale,
      getProgress: getProgress,
      GetStudentID: GetStudentID,
      isExport: isExport,
      reportAnswer: reportAnswer,
      resolvePath: resolvePath,
      resolveFontPath: resolveFontPath,
      setLessonProgress: setLessonProgress,
      setCourseProgress: setCourseProgress,
      setLocale: setLocale
    };

    updateParentTitle()
  }(window));
</script>
